import React, { Component } from "react";


class Home extends Component {
  render() {
    return (
      <div>
        <h2>Login</h2>
    		<p>Enter your credentials and login to lsn.</p>
        <Button variant="contained" color="primary">
        Login
        </Button>

   	</div>
    );
  }
}

export default Home;


